import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Navbar = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const navigate = useNavigate();

  const handleSearch = (e) => {
    e.preventDefault();
    if (searchQuery.trim() !== '') {
      navigate(`/search?q=${encodeURIComponent(searchQuery.trim())}`);
    }
  };

  return (
    <nav className="sticky top-0 z-50 bg-blue-600 text-white p-4 flex flex-wrap justify-between items-center gap-4">
      <div className="text-5xl font-tangerine">Demeter</div>

      <form onSubmit={handleSearch} className="flex-grow max-w-md flex items-center bg-white rounded-lg overflow-hidden shadow-sm">
        <input
          type="text"
          placeholder="Search..."
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          className="w-full px-4 py-2 text-black focus:outline-none"
        />
        <button
          type="submit"
          className="bg-blue-700 hover:bg-blue-800 text-white px-4 py-2 font-semibold"
        >
          Search
        </button>
      </form>

      <div className="space-x-4">
        <Link to="/landingPage" className="hover:underline">Home</Link>
        <Link to="/createLocation" className="hover:underline">New Location</Link>
      </div>
    </nav>
  );
};

export default Navbar;
